import prognozCSS from "../styles/prognoz.module.css";
import React from "react";

function Prognoz() {
  return (
    <>
      <div className={prognozCSS.mainContainer}>
        <div className={prognozCSS.eachDay}>вчера</div>
        <div className={prognozCSS.eachDay}>сегодня</div>
        <div className={prognozCSS.eachDay}>завтра</div>
        <div className={prognozCSS.eachDay}>ср</div>
        <div className={prognozCSS.eachDay}>чт</div>
      </div>
    </>
  );
}

export default Prognoz;
